import React,{Component} from 'react';
import './App.css';

class App extends Component {

  constructor(props) {
      super(props);
      this.state = { count: 0 , count1: 0 , count2: 0 , count3: 0 };
  }

  incrementCount = () => {
  this.setState(
          { count: this.state.count + 1 }
      );
};

  render() {
      return (
        <div className="languages">
          <h1>Vote Your Language!</h1>
          <div className="language_php">
            <div className="languageCount">0</div>
            <div className="languageName">dfghj</div>
            <div className="click" onClick={ this.incrementCount }>
              Clicks: { this.state.count }
            </div>
          </div>
          <div className="language_pyhton">
            <div className="languageCount">0</div>
            <div className="languageName">dfghj</div>
            <div className="click" onClick={ this.incrementCount }>
              Clicks: { this.state.count }
            </div>
          </div>
          <div className="language_go">
            <div className="languageCount">0</div>
            <div className="languageName">dfghj</div>
            <div className="click" onClick={ this.incrementCount }>
              Clicks: { this.state.count }
            </div>
          </div>
          <div className="language_java">
            <div className="languageCount">0</div>
            <div className="languageName">dfghj</div>
            <div className="click" onClick={ this.incrementCount }>
              Clicks: { this.state.count }
            </div>
          </div>
        </div>

      );
  }
}

export default App;
